import React from "react";
import { AppBar, Toolbar, Button, Typography, Image } from "@material-ui/core";

const CustomToolbar = ({title,options}) => {
  return(
    <AppBar class="nav" position="static">
      <Toolbar>
        <Typography class="nav-title">{title}</Typography>
        {options.map((value, index) => {
          return <Button>{value}</Button>
        })}
      </Toolbar>
    </AppBar>
  );
}

export default CustomToolbar;
